import "./App.css";
import { Switch, Route, withRouter } from "react-router-dom";

import Home from "./pages/Home";
import Music from "./"

import Navv from "./components/Navv";

function App() {


  return (
    <div className="App">
      <Navv />
      <Switch>
        <Route 
        exact
        path="/"
        render={() => {
          return <Home />;
        }}/>
      </Switch>
    </div>
  );
}

export default withRouter(App);
